Because methods always take a mutable reference as the first argument, even it the value is never changed, care must be taken when using shared values with methods. Usually data races are not possible in Rhai because, for each function call, there is ever only one value that is mutable – the first argument of a method. All other arguments are cloned. It is possible, however, to create a data race with a shared value, when the same value is used both as the object of a method call (including the this pointer) and also as an argument. // A method using the 'this' pointer and an argument
fn foo(x) { this + x
} let value = 42; // 'value' is not shared by default let f = || value; // this closure captures 'value' // ... at this point, 'value' is shared value.is_shared() == true; value.foo(value); // <- error: data race detected! The reason why it is a data race is because the variable value is shared , and cloning it merely clones a shared reference to it. Using it as the method call object (i.e. the this pointer) takes a mutable reference to the underlying value, which then cause a data race because a non-mutable reference is already outstanding due to the argument (which uses the same variable). Shared values are typically created from closures which capture external variable, so data races are not possible in Rhai under the no_closure feature.

