When calling a namespace-qualified function defined within a module, other functions defined within the same module script override any similar-named functions (with the same number of parameters) defined in the global namespace . This is to ensure that a module acts as a self-contained unit and functions defined in the calling script do not override module code. In some situations, however, it is actually beneficial to do it in reverse: have module code call functions defined in the calling script (i.e. in the global namespace ) if they exist, and only call those defined in the module script if none are found. One such situation is the need to provide a default implementation to a simulated virtual function: ┌────────────────┐
│ my_module.rhai │
└────────────────┘ // Do not do this (it will override the main script):
// fn message() { "hello! from module!" } // This function acts as the default implementation.
private fn default_message() { "hello! from module!" } // This function depends on a 'virtual' function 'message'
// which is not defined in the module script.
fn greet() { if is_def_fn("message", 0) { // 'is_def_fn' detects if 'message' is defined. print(message()); } else { print(default_message()); }
} ┌───────────┐
│ main.rhai │
└───────────┘ // The main script defines 'message' which is needed by the module script.
fn message() { "hi! from main!" } import "my_module" as m; m::greet(); // prints "hi! from main!" ┌────────────┐
│ main2.rhai │
└────────────┘ // The main script does not define 'message' which is needed by the module script. import "my_module" as m; m::greet(); // prints "hello! from module!"

