use rhai::{Dynamic, Engine, EvalAltResult}; #[derive(Debug, Clone, Eq, PartialEq, Hash)]
enum MyEnum { Foo, Bar(i64), Baz(String, bool),
} // Create a plugin module with functions constructing the 'MyEnum' variants
#[export_module]
mod MyEnumModule { // Constructors for 'MyEnum' variants pub const Foo: &MyEnum = MyEnum::Foo; pub fn Bar(value: i64) -> MyEnum { MyEnum::Bar(value) } pub fn Baz(val1: String, val2: bool) -> MyEnum { MyEnum::Baz(val1, val2) } // Access to fields #[rhai_fn(global, get = "enum_type", pure)] pub fn get_type(my_enum: &mut MyEnum) -> String { match my_enum { MyEnum::Foo => "Foo".to_string(), MyEnum::Bar(_) => "Bar".to_string(), MyEnum::Baz(_, _) => "Baz".to_string(), } } #[rhai_fn(global, get = "field_0", pure)] pub fn get_field_0(my_enum: &mut MyEnum) -> Dynamic { match my_enum { MyEnum::Foo => Dynamic::UNIT, MyEnum::Bar(x) => Dynamic::from(x), MyEnum::Baz(x, _) => Dynamic::from(x), } } #[rhai_fn(global, get = "field_1", pure)] pub fn get_field_1(my_enum: &mut MyEnum) -> Dynamic { match my_enum { MyEnum::Foo | MyEnum::Bar(_) => Dynamic::UNIT, MyEnum::Baz(_, x) => Dynamic::from(x), } } // Printing #[rhai_fn(global, name = "to_string", name = "to_debug", pure)] pub fn to_string(my_enum: &mut MyEnum) -> String { format!("{:?}", my_enum) } // '==' and '!=' operators #[rhai_fn(global, name = "==", pure)] pub fn eq(my_enum: &mut MyEnum, my_enum2: MyEnum) -> bool { my_enum == &my_enum2 } #[rhai_fn(global, name = "!=", pure)] pub fn neq(my_enum: &mut MyEnum, my_enum2: MyEnum) -> bool { my_enum != &my_enum2 }
} let mut engine = Engine::new(); // Load the module as the module namespace "MyEnum"
engine.register_type_with_name::<MyEnum>("MyEnum") .register_static_module("MyEnum", exported_module!(MyEnumModule).into()); With this API in place, working with enums feels almost the same as in Rust: let x = MyEnum::Foo; let y = MyEnum::Bar(42); let z = MyEnum::Baz("hello", true); x == MyEnum::Foo; y != MyEnum::Bar(0); // Detect enum types x.enum_type == "Foo"; y.enum_type == "Bar"; z.enum_type == "Baz"; // Extract enum fields y.field_0 == 42; y.field_1 == (); z.field_0 == "hello"; z.field_1 == true; Since enums are internally treated as custom types , they are not literals and cannot be used as a match case in switch statements. This is quite a limitation because the equivalent match statement is commonly used in Rust to work with enums and bind variables to variant-internal data. It is possible, however, to switch through enum variants based on their types: switch my_enum.enum_type { "Foo" => ..., "Bar" => { let value = foo.field_0; ... } "Baz" => { let val1 = foo.field_0; let val2 = foo.field_1; ... }
}

