Another way to work with Rust enums in a switch statement is through exposing the internal data (or at least those that act as effective discriminants ) of each enum variant as a variable-length array , usually with the name of the variant as the first item for convenience: use rhai::Array; engine.register_get("enum_data", |my_enum: &mut MyEnum| { match my_enum { MyEnum::Foo => vec![ "Foo".into() ] as Array, // Say, skip the data field because it is not // used as a discriminant MyEnum::Bar(value) => vec![ "Bar".into() ] as Array, // Say, all fields act as discriminants MyEnum::Baz(val1, val2) => vec![ "Baz".into(), val1.clone().into(), (*val2).into() ] as Array }
}); Then it is a simple matter to match an enum via a switch expression. // Assume 'value' = 'MyEnum::Baz("hello", true)'
// 'enum_data' creates a variable-length array with 'MyEnum' data
let x = switch value.enum_data { ["Foo"] => 1, ["Bar"] => value.field_1, ["Baz", "hello", false] => 4, ["Baz", "hello", true] => 5, _ => 9
}; x == 5; // Which is essentially the same as:
let x = switch [value.type, value.field_0, value.field_1] { ["Foo", (), ()] => 1, ["Bar", 42, ()] => 42, ["Bar", 123, ()] => 123, : ["Baz", "hello", false] => 4, ["Baz", "hello", true] => 5, _ => 9
} Usually, a helper method returns an array of values that can uniquely determine the switch case based on actual usage requirements – which means that it probably skips fields that contain data instead of discriminants. Then switch is used to very quickly match through a large number of array shapes and jump to the appropriate case implementation. Data fields can then be extracted from the enum independently.

