Rhai values are typically cloned when passed around, especially into function calls. Large data structures may incur material cloning overhead. Some functions accept the first parameter as a mutable reference (i.e. &mut), for example methods for custom types , and may avoid potentially-costly cloning. For example, the += (append) compound assignment takes a mutable reference to the variable while the corresponding + (add) assignment usually doesn't. The difference in performance can be huge: let x = create_some_very_big_type(); x = x + 1;
// ^ 'x' is cloned here // The above is equivalent to:
let temp_value = x + 1;
x = temp_value; x += 1; // <- 'x' is NOT cloned

